import React, { useState } from "react";


function App() {
  [date, setDate] = useState([
    {
      "id":1,"color":"red"
    },
    {
      "id":2,"color":"blue"
    }
  ])

  return(
    <div>
      {date.map(p=>(p.date))}
    </div>
  )
};

export default App;
